import { useEffect } from 'react';
import '../ProfileDetails/ProfileDetails.css'
import { useParams } from 'react-router-dom'
import axios from 'axios';

export const ProfileDetails = () => {

    const id = useParams();
    console.log(id)

    useEffect (() => {
        (async() => {
            try {
                console.log(`http://localhost:3500/api/SingleProfile/${id}`);
                const data = await axios.get(`http://localhost:3500/api/SingleProfile/${id}`)
                console.log(data)
            } catch (error) {
                console.log(error)
            }
        })()
    }, [id])

    return <h1>ProfileDetails</h1>
}
